    true,nt"url": null,nt"notes": "The Foreign Gift and Contracts Report, 2011
    (FG2011), is a collection that is part of the Foreign Gift and Contracts Report
    (FG) program; program data is available since 2009 at <https://studentaid.ed.gov/sa/foreign>.
    FG2011 (https://studentaid.ed.gov/sa/foreign) is a universe data collection regarding
    all gifts received from any foreign source, contracts with a foreign entity, and/or
    any ownership interests in or control over the institution by a foreign entity reported
    by Title IV-eligible domestic institutions that offer a bachelor's degree or higher,
    or that offer a transfer program of not less than two years that is acceptable for
    credit toward a bachelor's degree, when the total value of all gifts given in a
    calendar year is $250,000 or greater or if the institution is owned or controlled
    by a foreign source. Key statistics produced from FG2011 were information on the
    gifts of money and property institutions received.",nt"license_title": "Creative
